import React from 'react';
import PropTypes from 'prop-types';

const RedBox = () => {
  const boxStyle = {
    margin: '0',
    pading: '0',
    display: 'flex',
    minHeight: '100vh', 
    flex: '1', 
    backgroundColor: '3498db',
    height: '100px',

  };

  return (
    <div style={boxStyle}>
        <h1>Place Holder text</h1>
    </div>
  );
};

RedBox.propTypes = {
  leftText: PropTypes.string,
  rightText: PropTypes.string,
};

RedBox.defaultProps = {
  leftText: 'Net Worth',
  rightText: '$0',
};

export default RedBox;
